import place from './placeholder.png';
import React from 'react';
import './App.css';


function App() {
  return (
    <div>
      <ul>
        <li>
          <img src="placeholder.png" class="image" />
          <div class="name">
            SERIES
          </div>
        </li>
        <li>
          <img src="placeholder.png" class="image"/>
          <div class="name2">
            MOVIES
          </div>
        </li>
      </ul>
    </div>
  );
}

export default App;
